import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Landing from './components/Landing'
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
      <Routes>
          {/* <Route exact path='/' component={Landing} /> */}
          <Route exact path='/'>
            <Landing />
          </Route>
          <Route path='/home' component={Home} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
